module Sbre.Benchmarks.Twain

open System
open System.IO
open System.Text.RuntimeRegexCopy
open BenchmarkDotNet.Attributes
open Sbre


let paragraph = """

"That for your English strongholds!" and Joan snapped her fingers
scornfully. "Whence have we marched in these last days? From
Gien. And whither? To Rheims. What bristled between? English
strongholds. What are they now? French ones--and they never cost
a blow!" Here applause broke out from the group of generals, and
Joan had to pause a moment to let it subside. "Yes, English
strongholds bristled before us; now French ones bristle behind us.
What is the argument? A child can read it. The strongholds
between us and Paris are garrisoned by no new breed of English,
but by the same breed as those others--with the same fears, the
same questionings, the same weaknesses, the same disposition to
see the heavy hand of God descending upon them. We have but to
march!--on the instant--and they are ours, Paris is ours, France is
ours! Give the word, O my King, command your servant to--"

"""

[<BenchmarkDotNet.Attributes.MemoryDiagnoser>]
[<ShortRunJob>]
type ConjunctionShort1() =



    // init engines
    let pattern1_lookaround = @"\n\n((?!\n\n)[\s\S])*?English((?!\n\n)[\s\S])*?\n\n"
    let pattern1_nonlookaround = @"\n\n((.+\n)+?(.*English.*)(.+\n)+?)\n"
    let pattern1_conjunct_negation = @"\n\n~(⊤*\n\n⊤*)&⊤*English⊤*"
    let pattern1_conjunct_true = @"\n\n⊤*\n\n&⊤*English⊤*"


    let r_back_1_lookaround = System.Text.RegularExpressions.Regex(
        pattern1_nonlookaround,
        options=System.Text.RegularExpressions.RegexOptions.None,
        matchTimeout=TimeSpan.FromMilliseconds(10_000.))
    let r_back_1_nonlookaround = System.Text.RegularExpressions.Regex(
        pattern1_lookaround,
        options=System.Text.RegularExpressions.RegexOptions.None,
        matchTimeout=TimeSpan.FromMilliseconds(10_000.))
    let r_non_1 = System.Text.RegularExpressions.Regex(
        pattern1_nonlookaround,
        options=System.Text.RegularExpressions.RegexOptions.NonBacktracking,
        matchTimeout=TimeSpan.FromMilliseconds(10_000.))

    let r_sbre_lookaround_1 = Matcher(pattern1_lookaround)
    let r_sbre_conj_true_1 = Matcher(pattern1_conjunct_true)
    let r_sbre_conj_neg_1 = Matcher(pattern1_conjunct_negation)


    //
    [<Benchmark>] member x.backtracking_1_lookaround() = r_back_1_lookaround.Match(paragraph)
    [<Benchmark>] member x.backtracking_1_nolookaround() = r_back_1_nonlookaround.Match(paragraph)
    [<Benchmark>] member x.non_backtracking_1() = r_non_1.Match(paragraph)
    [<Benchmark>] member x.sbre_lookaround_1() = r_sbre_lookaround_1.FindMatchEnd(paragraph)
    [<Benchmark>] member x.sbre_conj_true_1() = r_sbre_conj_true_1.FindMatchEnd(paragraph)
    [<Benchmark>] member x.sbre_conj_neg_1() = r_sbre_conj_neg_1.FindMatchEnd(paragraph)


