    let r_nonbacktracking = System.Text.RegularExpressions.Regex(
        pat_nolookaround,
        options=System.Text.RegularExpressions.RegexOptions.NonBacktracking,
        matchTimeout=TimeSpan.FromMilliseconds(10_000.))

    let r_sbre_conj_neg = Matcher(pat_conj_neg)

